  03> FINLAYSON, Margaret Anne m on 05.03.1994 to MACALISTER, Philip Duncan
  b 22.02.1959
  b 04.11.1960
  Address: 196 Spencer Road, Rotorua.
  Margaret was educated at St Cuthbert's College and Otago University (BCom). She is now Business
  Service Manager with the Department of Conservation in Rotorua. Philip was educated at Rathkeale
  College and is a journalist specialising in business and personal finance.
  They live at Lake Tarawera with their two children. Their interests include sailing, boating and
  mountain biking.
  01> MACALISTER, Jamie Lachlan
  b 03.01.1995
  02> MACALISTER, Scott Angus
  b 03.05.1996
  64> FINLAYSON, Charles Cecil
  b 07.03.1961
  Address: PO Box 22, Pio Pio. Charles is intellectually handicapped. He has been in Tokanui
