  05> FINLAYSON, Cynthia Joy m on 04.03.1989 to HURLEY, Peter James
  b 15.02.1964
  b 31.07.1958
  Address: Waitewhena Road, RD, Aria.
  Joy was educated at Pio Pio and St Cuthbert's College. She trained at Waikato Technical Institute
  as a secretary then worked for a time before travelling overseas. Her interests include horse
  riding, tennis, skiing, squash and gardening.
  Peter was educated at Te Kuiti and New Plymouth Boys' High School. He played rugby for Waikato and
  King Country and he also travelled to France to play rugby. His interests include fishing, tennis,
  skiing and squash.
  Joy and Peter are sheep and beef farmers at Aria. They love raising their children in the farm
  environment. Each summer the family travels to Cooks Beach for their holidays. The children
  attend Aria School and the family are very involved in community activities.
